import React, { useEffect, useState } from 'react'

const Test = () => {
    const [data,setData] = useState();
    useEffect(()=>{
        fetch('https://api.github.com/users/anilkapse1').
        then(response=>response.json()).
        then(data=>setData(data))
    },[])

    console.log(data);
  return (
    <div>Test</div>
  )
}

export default Test
